import React from "react";
import { Container, Nav, Row, Col } from "react-bootstrap";
import Footer from "./components/Footer";
import Hero from "./components/Hero";
import PortfolioHero from "./components/PortfolioHero";
import PortfolioDescription from "./components/PortfolioDescription";

const Lenovo = () => (
  <Container>
    <PortfolioHero
      PortfolioLink="lenovo"
      ImageLink="https://via.placeholder.com/1400x600"
      ImageAlt="Description"
      Headline="U.S. Census Bureau: Census Survey Explorer"
      Subheader="I built a web application to help data users find 130+ U.S. Census Bureau surveys and programs."
      Overview="Knowing how to wrangle and work with complex datasets is far from easy. As a Civic Digital Fellow with Coding it Forward, I redesigned the user experience and proposed new methods to help the U.S. Census Bureauâ€™s digital learning hub, Census Academy, teach beginners data skills."
    />
    <Row></Row>
    <PortfolioDescription title="Team">
      <p>
        Amy Lo, UX Design
        <br />
        Elliott Tran, UX Research
        <br />
        Alexandra Barker, Manager
        <br />
        Mary Leisenring, Manager
        <br />
        Anthony Calabrese, Manager
      </p>
    </PortfolioDescription>
  </Container>
);

export default Lenovo;
